import React from "react";

const Weather1 = ({ data, text }) => {
  return (
    <div className="weather1">
      <img src="https://www.theweather.com/wimages/foto1c57d79984397d0508b62ab57f5f7912.png" />
    </div>
  )
}

export default Weather1;
